import React,{useState,useEffect} from 'react'

const Kart = () => {
  const [cart,setCart]=useState()
  useEffect(() => {
    getCart()
  }, [])

  const getCart=()=>{
    // const response = await axios.get(CATALOG_URL)
    const response = {
      "id": 1,
      "userId": 1,
      "item": [ 
      {
      "itemId":"abc",
      "quantity": 1, 
      "cost": 100,
      "price": 100
      }
      ]
      }
  setCart(response)
  }

  return (
    <div className='conatiner-fluid'>
      <div className='row'>
        <div className="col-md-12">
          <table className='table'>
            <thead>
              <tr>
                {/* <th>Product</th> */}
                <th>Name</th>
                <th>Price</th>
                <th>Quantity</th>
                <th>Total</th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              {
                cart?.item.map((element) => {
                  console.log('cartitem',element);
                  return(<tr>
                    {/* <td><img src={} alt="" /></td> */}
                    <td>{element?.itemId}</td>
                    <td>{element?.cost}</td>
                    <td><input type="number" name="" value={element?.quantity} id="" min={1} max={10} style={{width:50}}/></td>
                    <td>{element?.price}</td>
                    <td><i className="material-icons">&#xe872;</i></td>
                  </tr>)
                })
              }

            </tbody>
          </table>
          <h3 id="cart-total">Cart Total</h3>
          <div className='d-flex justify-content-between'>
            <span>Cart Totals</span>
            <span>Number of items: 1</span>
            <span>Total: £209</span>
          </div>
          <button className='btn btn-outline-primary'>Checkout</button>
        </div>
      </div>
    </div>
  )
}

export default Kart
